import React from "react";

function Card(props){
    return(
      <div className="container">
  <div className="cards">
     <div className="card">
       <img src={props.imgsrc} alt="" />
       <div className="card_info">
         <span className="car_category">{props.title}</span>
         <h3 className="card_tile">{props.sname}</h3>
         <a href={props.Link}>
           <button>Click Now</button>
         </a>
       </div>
     </div>
   </div>
   </div>
    )
  };
